import React from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import { useAuth0 } from "@auth0/auth0-react";

function Dashboard() {
  const { user, isAuthenticated } = useAuth0();

  if (!isAuthenticated) {
    return <p>Please log in to access your dashboard.</p>;
  }

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh", // Centers the card vertically and horizontally
        backgroundColor: "#f8f9fa", // Light gray background
      }}
    >
      <Card style={{ width: "600px", padding: "20px", borderRadius: "12px" }}>
        <div
          style={{
            display: "flex",
            alignItems: "center",
            marginBottom: "20px",
          }}
        >
          {/* User Icon */}
          <img
            src={user.picture}
            alt="User"
            style={{
              width: "100px",
              height: "100px",
              borderRadius: "50%",
              marginRight: "20px",
            }}
          />
          {/* User Name */}
          <div>
            <h2 style={{ margin: 0 }}>{user.name}</h2>
          </div>
        </div>

        {/* Action Buttons */}
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            marginTop: "20px",
          }}
        >
          <div style={{ textAlign: "center", flex: 1, marginRight: "10px" }}>
            <h5>Start Call</h5>
            <Button variant="primary" style={{ width: "100%" }}>
              Start
            </Button>
          </div>
          <div style={{ textAlign: "center", flex: 1, marginLeft: "10px" }}>
            <h5>Start Learning</h5>
            <Button variant="success" style={{ width: "100%" }}>
              Learn
            </Button>
          </div>
        </div>
      </Card>
    </div>
  );
}

export default Dashboard;
